INSERT INTO `testimonials` (`id`, `user_id`, `client_image`, `client_name`, `client_rating`, `client_review`, `created_at`, `updated_at`) VALUES
(1, 1, 'nvz8WWnDn1MgczL2NS10B2JskKfaYEoYN2SZHTvW.png', 'Michael Charsac', '5', 'I can\'t thank Cassidy enough for his outstanding support during my home-buying journey. From our first meeting, he took the time to understand my needs and preferences. Cassidy was always quick to respond to my questions and provided expert guidance every step of the way. His deep knowledge of the local market helped me find the perfect home at a great price. If you\'re in the market for a realtor who is both passionate and professional, Cassidy is the one to call!', '2024-10-12 21:01:05', '2024-10-13 05:18:46'),
(2, 2, '2nniPGBVizNZGatllhxRCXqwsRw0RaSgE5sPbhR2.png', 'Victor Kalu', '4', 'I recently worked with Cassidy to sell my property, and I am so grateful for his expertise and professionalism. Cassidy was always available to address my concerns and provided invaluable advice throughout the process. His marketing strategies brought in multiple offers, and we closed at a price above my expectations! If you\'re looking for a dedicated realtor who truly cares about his clients, I highly recommend Cassidy. He made the entire experience smooth and stress-free!', '2024-10-12 21:06:41', '2024-10-13 05:17:35'),
(6, 1, 'zdWDaoWWh4dY9CZgEeO0c1rCV2jypR3qp2qA5UlV.png', 'Mercy Obed', '2', 'I had the pleasure of working with Cassidy during my home-buying journey, and I couldn\'t be happier with the experience! From our first meeting, he was incredibly knowledgeable about the market and attentive to my needs. Cassidy guided me through every step, answering all my questions and ensuring I felt confident in my decisions. Thanks to his dedication, I found my dream home at a fantastic price. I highly recommend Cassidy to anyone looking to buy or sell a home!', '2024-10-13 05:15:51', '2024-10-13 05:15:51'),
(9, 2, 'G1RAhWo67tOzuAGQ1ZqpXqRkuZommdGhVbNMvNHT.jpg', 'Oluchi Cassidy ', '4', 'lorem though ethim may ipsu lorem ti that re ti osiefosies fis eis fisd fisf sdif seif sif esif sf sef esif sef sif sif ei fsoif sef soif sif soef ', '2024-10-17 02:53:15', '2024-10-17 02:53:15');

